import React from "react";
import Menu from "../../private/pages/menu";
import Login from "../../public/login";
const Switch = ({ page, }) => {
  switch (page) {
    case "login":
      return <Login />;
    case "menu":
      return <Menu />;
    default:
      return <div>Invalid page</div>;
  }
};

export default Switch;
